/**
 * Bloom Filter â€” 49,762 known phishing + malware domains
 * Sources: curbengh/phishing-filter, curbengh/urlhaus-filter  
 * False positive rate: ~0.1%
 * Size: ~116KB embedded (vs 1.4MB raw)
 */

const BLOOM_DATA = "";
const BLOOM_BITS = 715457;
const BLOOM_HASHES = 9;

let _bitArray: Uint8Array | null = null;

function getBitArray(): Uint8Array {
  if (_bitArray) return _bitArray;
  const raw = atob(BLOOM_DATA);
  _bitArray = new Uint8Array(raw.length);
  for (let i = 0; i < raw.length; i++) _bitArray[i] = raw.charCodeAt(i);
  return _bitArray;
}

function fnv1a(item: string, seed: number): number {
  let h = ((seed * 0x100000001 + 0x9e3779b9) & 0xFFFFFFFF) >>> 0;
  for (let i = 0; i < item.length; i++) {
    h = (((h ^ item.charCodeAt(i)) >>> 0) * 0x01000193) >>> 0;
  }
  return h % BLOOM_BITS;
}

/**
 * Check if domain might be in the blocklist.
 * true = possibly blocked (0.1% false positive rate)
 * false = definitely NOT blocked
 */
export function isDomainInBloom(domain: string): boolean {
  const bits = getBitArray();
  const clean = domain.toLowerCase().replace(/^www\\./, "");
  for (let i = 0; i < BLOOM_HASHES; i++) {
    const h = fnv1a(clean, i);
    if (!(bits[h >> 3] & (1 << (h & 7)))) return false;
  }
  return true;
}

export const BLOOM_DOMAIN_COUNT = 49762;
